INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 119901, 14, 0, "ミヤコ（クリスマス）", "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 2.17, 1, "みやこ", 3, 302, 450, 0, 119901, 0, 0, 1, "2024/12/22 12:00:00", 119901, "2024/12/31 11:59:59", 119901, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 120001, 6, 0, "シズル（ノワール）", "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 2.375, 1, "しずる", 3, 190, 450, 0, 120001, 0, 0, 5, "2025/03/10 12:00:00", 120001, "2025/03/15 14:59:59", 120001, 1, 0, 0);
