INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 120601, 0, 0, "キョウカ（リトルリリカル）", "", 0.0, 1, "きょうか", 3, 465, 0, 0, 0, 0, 180801, 0, "2015/04/01 15:00:00", 120601, "2030/12/31 15:00:00", 0, 0, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (22, 120701, 1, 0, "シェフィ（ニューイヤー）", "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 1.84, 1, "しぇふぃ", 3, 283, 450, 0, 120701, 0, 0, 4, "2025/01/15 15:00:00", 120701, "2025/01/20 11:59:59", 120701, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (22, 120801, 2, 0, "ルカ（ニューイヤー）", "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 1.3, 1, "るか", 1, 193, 450, 0, 120801, 0, 0, 4, "2023/10/16 15:00:00", 120801, "2030/12/31 15:00:00", 120801, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (38, 120901, 12, 0, "イリヤ（ニューイヤー）", "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 1.425, 1, "いりや", 3, 424, 450, 0, 120901, 0, 0, 3, "2025/01/15 15:00:00", 120901, "2025/01/20 11:59:59", 120901, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (41, 121001, 1, 0, "ペコリーヌ（オーバーロード）", "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 2.25, 1, "ぺこりーぬ", 3, 164, 450, 0, 121001, 0, 0, 5, "2025/02/20 12:00:00", 121001, "2025/02/24 11:59:59", 121001, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (42, 121101, 1, 0, "キャル（オーバーロード）", "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 2.07, 1, "きゃる", 3, 588, 450, 0, 121101, 0, 0, 7, "2025/02/20 12:00:00", 121101, "2025/02/24 11:59:59", 121101, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (40, 121201, 6, 0, "ラビリスタ（オーバーロード）", "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 1.55, 1, "らびりすた", 1, 260, 450, 0, 121201, 0, 0, 4, "2023/11/16 15:00:00", 121201, "2030/12/31 15:00:00", 121201, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (3, 121301, 3, 0, "クルミ（ステージ）", "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 1.9, 0, "くるみ", 3, 731, 450, 0, 121301, 0, 0, 3, "2022/03/03 19:00:00", 121301, "2030/12/31 15:00:00", 121301, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 121401, 15, 0, "ミサキ（ステージ）", "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 2.27, 0, "みさき", 3, 742, 450, 0, 121401, 0, 0, 7, "2022/03/15 15:00:00", 121401, "2030/12/31 15:00:00", 121401, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (6, 121501, 12, 0, "アユミ（怪盗）", "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 2.0, 1, "あゆみ", 3, 590, 450, 0, 121501, 0, 0, 6, "2025/04/26 12:00:00", 121501, "2025/04/30 11:59:59", 121501, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (3, 121601, 17, 0, "イノリ（怪盗）", "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 1.425, 0, "いのり", 3, 292, 450, 0, 121601, 0, 0, 3, "2022/04/15 15:00:00", 121601, "2030/12/31 15:00:00", 121601, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 121701, 0, 0, "アキノ（アキノ＆サレン）", "", 0.0, 1, "あきの", 3, 421, 0, 0, 0, 0, 180901, 0, "2015/04/01 15:00:00", 121701, "2030/12/31 15:00:00", 0, 0, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 121801, 0, 0, "サレン（アキノ＆サレン）", "", 0.0, 1, "されん", 3, 421, 0, 0, 0, 0, 180901, 0, "2015/04/01 15:00:00", 121801, "2030/12/31 15:00:00", 0, 0, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 121901, 12, 0, "アンナ（パイレーツ）", "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 2.125, 0, "あんな", 3, 293, 450, 0, 121901, 0, 0, 5, "2022/05/15 15:00:00", 121901, "2030/12/31 15:00:00", 121901, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (3, 122001, 14, 0, "シノブ（パイレーツ）", "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 1.425, 0, "しのぶ", 3, 380, 450, 0, 122001, 0, 0, 3, "2022/05/03 19:00:00", 122001, "2030/12/31 15:00:00", 122001, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (35, 122101, 9, 0, "アオイ（キャンプ）", "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 1.97, 1, "あおい", 1, 731, 450, 0, 122101, 0, 0, 35, "2024/04/18 15:00:00", 122101, "2030/12/31 15:00:00", 122101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (4, 122201, 8, 0, "ユカリ（キャンプ）", "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 1.84, 0, "ゆかり", 3, 419, 450, 0, 122201, 0, 0, 4, "2022/05/31 12:00:00", 122201, "2030/12/31 15:00:00", 122201, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (43, 122301, 0, 0, "ヴァンピィ", "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 1.425, 0, "うぁんぴぃ", 3, 564, 450, 0, 122301, 0, 0, 43, "2022/06/15 15:00:00", 122301, "2030/12/31 15:00:00", 122301, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 122401, 8, 0, "ヒヨリ（サマー）", "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 2.42, 1, "ひより", 1, 264, 450, 0, 122401, 0, 0, 1, "2024/06/17 15:00:00", 122401, "2030/12/31 15:00:00", 122401, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (4, 122501, 0, 0, "レイ（サマー）", "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 1.965, 1, "れい", 3, 250, 450, 0, 122501, 0, 0, 4, "2024/08/26 19:00:00", 122501, "2024/08/31 11:59:59", 122501, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 122601, 0, 0, "ユイ（サマー）", "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 2.27, 0, "ゆい", 3, 554, 450, 0, 122601, 0, 0, 7, "2022/07/15 15:00:00", 122601, "2030/12/31 15:00:00", 122601, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 122701, 0, 0, "キョウカ（サマー）", "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 1.92, 0, "きょうか", 3, 812, 450, 0, 122701, 0, 0, 7, "2022/08/15 15:00:00", 122701, "2030/12/31 15:00:00", 122701, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 122801, 0, 0, "ミソギ（サマー）", "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 2.295, 1, "みそぎ", 1, 237, 450, 0, 122801, 0, 0, 1, "2024/07/16 15:00:00", 122801, "2030/12/31 15:00:00", 122801, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 122901, 0, 0, "ミミ（サマー）", "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 2.25, 1, "みみ", 3, 361, 450, 0, 122901, 0, 0, 5, "2024/08/26 19:00:00", 122901, "2024/08/31 11:59:59", 122901, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (44, 123001, 0, 0, "アメス", "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 2.27, 1, "あめす", 3, 746, 450, 0, 123001, 0, 0, 44, "2025/04/30 12:00:00", 123001, "2025/05/03 18:59:59", 123001, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 123101, 0, 0, "マホ（エクスプローラー）", "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 1.795, 0, "まほ", 3, 793, 450, 0, 123101, 0, 0, 7, "2022/09/03 19:00:00", 123101, "2030/12/31 15:00:00", 123101, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (3, 123201, 0, 0, "アヤネ（エクスプローラー）", "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 1.425, 0, "あやね", 3, 256, 450, 0, 123201, 0, 0, 3, "2022/09/15 15:00:00", 123201, "2030/12/31 15:00:00", 123201, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 123301, 0, 0, "ネア", "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 1.62, 1, "ねあ", 3, 350, 450, 0, 123301, 0, 0, 1, "2024/09/25 12:00:00", 123301, "2024/09/30 11:59:59", 123301, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 123401, 0, 0, "ジュン（キャンプ）", "", 0.0, 0, "じゅん", 3, 0, 0, 0, 0, 0, 0, 5, "2015/04/01 15:00:00", 123401, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (6, 123501, 0, 0, "リン（ハロウィン）", "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 2.34, 1, "りん", 1, 583, 450, 0, 123501, 0, 0, 6, "2024/09/17 15:00:00", 123501, "2030/12/31 15:00:00", 123501, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (4, 123601, 0, 0, "トモ（ハロウィン）", "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 1.965, 1, "とも", 3, 262, 450, 0, 123601, 0, 0, 4, "2024/10/24 12:00:00", 123601, "2024/10/28 11:59:59", 123601, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 123701, 0, 0, "ナナカ（ハロウィン）", "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 2.07, 0, "ななか", 3, 741, 450, 0, 123701, 0, 0, 7, "2022/10/15 15:00:00", 123701, "2030/12/31 15:00:00", 123701, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 123801, 0, 0, "クリスティーナ（ワイルド）", "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 2.295, 1, "くりすてぃーな", 3, 238, 450, 0, 123801, 0, 0, 1, "2024/11/26 12:00:00", 123801, "2024/11/30 11:59:59", 123801, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (2, 123901, 0, 0, "マツリ（ワイルド）", "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 2.125, 0, "まつり", 3, 183, 450, 0, 123901, 0, 0, 2, "2022/11/15 15:00:00", 123901, "2030/12/31 15:00:00", 123901, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 124001, 0, 0, "アカリ（クリスマス）", "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 2.07, 1, "あかり", 3, 438, 450, 0, 124001, 0, 0, 7, "2024/12/22 12:00:00", 124001, "2024/12/31 11:59:59", 124001, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (6, 124101, 0, 0, "ヨリ（クリスマス）", "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 1.965, 1, "より", 1, 433, 450, 0, 124101, 0, 0, 6, "2024/11/16 15:00:00", 124101, "2030/12/31 15:00:00", 124101, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 124201, 0, 0, "ジュン（クリスマス）", "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 2.07, 0, "じゅん", 3, 144, 450, 0, 124201, 0, 0, 5, "2022/12/23 12:00:00", 124201, "2030/12/31 15:00:00", 124201, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 124301, 0, 0, "アン（アン＆グレア）", "", 0.0, 1, "あん", 3, 577, 0, 0, 0, 0, 181001, 0, "2015/04/01 15:00:00", 124301, "2030/12/31 15:00:00", 0, 0, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 124401, 0, 0, "グレア（アン＆グレア）", "", 0.0, 1, "ぐれあ", 3, 577, 0, 0, 0, 0, 181001, 0, "2015/04/01 15:00:00", 124401, "2030/12/31 15:00:00", 0, 0, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 124501, 0, 0, "ホマレ（ニューイヤー）", "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 2.07, 1, "ほまれ", 3, 707, 450, 0, 124501, 0, 0, 7, "2025/01/15 15:00:00", 124501, "2025/01/20 11:59:59", 124501, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 124601, 0, 0, "ミサト（ニューイヤー）", "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 2.44, 1, "みさと", 3, 698, 450, 0, 124601, 0, 0, 7, "2025/01/15 15:00:00", 124601, "2025/01/20 11:59:59", 124601, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (46, 124701, 0, 0, "ミツキ（ニューイヤー）", "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 2.24, 1, "みつき", 1, 590, 450, 0, 124701, 0, 0, 7, "2024/12/16 15:00:00", 124701, "2030/12/31 15:00:00", 124701, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 124801, 0, 0, "ノゾミ（リベレイター）", "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 2.14, 1, "のぞみ", 3, 423, 450, 0, 124801, 0, 0, 4, "2025/02/20 12:00:00", 124801, "2025/02/24 11:59:59", 124801, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 124901, 0, 0, "カヤ（リベレイター）", "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 1.965, 1, "かや", 1, 170, 450, 0, 124901, 0, 0, 1, "2025/01/16 15:00:00", 124901, "2030/12/31 15:00:00", 124901, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 125001, 0, 0, "ムイミ（リベレイター）", "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 1.965, 1, "むいみ", 3, 221, 450, 0, 125001, 0, 0, 5, "2025/02/20 12:00:00", 125001, "2025/02/24 11:59:59", 125001, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (47, 125101, 0, 0, "タマキ（カフェ）", "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 2.24, 0, "たまき", 3, 825, 450, 0, 125101, 0, 0, 8, "2023/03/03 19:00:00", 125101, "2030/12/31 15:00:00", 125101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (4, 125201, 0, 0, "モニカ（カフェ）", "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 1.965, 0, "もにか", 3, 463, 450, 0, 125201, 0, 0, 4, "2023/03/10 12:00:00", 125201, "2030/12/31 15:00:00", 125201, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (6, 125301, 0, 0, "コッコロ（レンジャー）", "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 2.07, 1, "こっころ", 3, 752, 450, 0, 125301, 0, 0, 6, "2025/04/26 12:00:00", 125301, "2025/04/30 11:59:59", 125301, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (8, 125401, 0, 0, "シオリ（レンジャー）", "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 2.09, 0, "しおり", 3, 710, 450, 0, 125401, 0, 0, 8, "2023/04/10 12:00:00", 125401, "2030/12/31 15:00:00", 125401, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (50, 125501, 0, 0, "ジータ（ウォーロック）", "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 1.92, 1, "じーた", 3, 443, 450, 0, 125501, 0, 0, 7, "2024/05/10 12:00:00", 125501, "2024/05/15 14:59:59", 125501, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 125601, 0, 0, "ビカラ", "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 2.09, 1, "びから", 3, 267, 450, 0, 125601, 0, 0, 51, "2024/05/10 12:00:00", 125601, "2024/05/15 14:59:59", 125601, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (9, 125701, 0, 0, "カリン（アルケミスト）", "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 2.24, 1, "かりん", 1, 579, 450, 0, 125701, 0, 0, 7, "2025/04/16 15:00:00", 125701, "2030/12/31 15:00:00", 125701, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 125801, 0, 0, "リリ（フォールン）", "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 2.09, 0, "りり", 3, 464, 450, 0, 125801, 0, 0, 3, "2023/04/17 12:00:00", 125801, "2030/12/31 15:00:00", 125801, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 125901, 0, 0, "カヤ（リベレイター）", "", 0.0, 1, "かや", 3, 0, 0, 0, 0, 0, 0, 1, "2015/04/01 15:00:00", 125901, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 126001, 0, 0, "クリア（フォールン）", "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 2.09, 0, "くりあ", 3, 406, 450, 0, 126001, 0, 0, 0, "2023/10/31 12:00:00", 126001, "2030/12/31 15:00:00", 126001, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (53, 126101, 0, 0, "プレシア（フォールン）", "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 2.09, 0, "ぷれしあ", 3, 480, 450, 0, 126101, 0, 0, 44, "2023/11/15 15:00:00", 126101, "2030/12/31 15:00:00", 126101, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (3, 126201, 0, 0, "イリヤ（儀装束）", "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 2.09, 1, "いりや", 3, 568, 450, 0, 126201, 0, 0, 3, "2024/06/10 12:00:00", 126201, "2024/06/15 14:59:59", 126201, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (9, 126301, 0, 0, "ユキ（儀装束）", "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 2.07, 0, "ゆき", 3, 456, 450, 0, 126301, 0, 0, 7, "2023/06/15 15:00:00", 126301, "2030/12/31 15:00:00", 126301, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 126401, 0, 0, "クローチェ", "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 2.09, 1, "くろーちぇ", 3, 373, 450, 0, 126401, 0, 0, 1, "2025/04/30 12:00:00", 126401, "2025/05/03 18:59:59", 126401, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 126501, 0, 0, "ライラエル", "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 1.965, 1, "らいらえる", 3, 740, 450, 0, 126501, 0, 0, 7, "2025/04/30 12:00:00", 126501, "2025/05/03 18:59:59", 126501, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 126601, 0, 0, "ネネカ（サマー）", "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 2.04, 1, "ねねか", 3, 650, 450, 0, 126601, 0, 0, 7, "2024/07/11 12:00:00", 126601, "2024/07/15 14:59:59", 126601, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 126701, 0, 0, "アキノ（サマー）", "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 1.965, 1, "あきの", 1, 224, 450, 0, 126701, 0, 0, 5, "2023/06/30 12:00:00", 126701, "2030/12/31 15:00:00", 126701, 1, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 126801, 0, 0, "ユカリ（サマー）", "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 1.97, 0, "ゆかり", 3, 159, 450, 0, 126801, 0, 0, 5, "2023/07/15 15:00:00", 126801, "2030/12/31 15:00:00", 126801, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 126901, 0, 0, "ランファ（サマー）", "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 1.965, 1, "らんふぁ", 3, 682, 450, 0, 126901, 0, 0, 7, "2024/08/09 12:00:00", 126901, "2024/08/12 11:59:59", 126901, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (52, 127001, 0, 0, "クウカ（サマー）", "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 1.97, 1, "くうか", 1, 133, 450, 0, 127001, 0, 0, 2, "2023/07/31 12:00:00", 127001, "2023/08/14 20:59:59", 127001, 1, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (46, 127101, 0, 0, "シノブ（サマー）", "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 2.09, 1, "しのぶ", 3, 255, 450, 0, 127101, 0, 0, 5, "2024/08/09 12:00:00", 127101, "2024/08/12 11:59:59", 127101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 127201, 0, 0, "キャル（編入生）", "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 2.09, 1, "きゃる", 3, 804, 450, 0, 127201, 0, 0, 7, "2024/10/10 12:00:00", 127201, "2024/10/13 11:59:59", 127201, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (8, 127301, 0, 0, "スズナ（編入生）", "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 2.09, 0, "すずな", 3, 750, 450, 0, 127301, 0, 0, 8, "2023/09/15 15:00:00", 127301, "2030/12/31 15:00:00", 127301, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 127401, 0, 0, "ビカラ（コラボ）", "", 0.0, 1, "びから", 3, 0, 0, 0, 0, 0, 0, 1, "2015/04/01 15:00:00", 127401, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (4, 127501, 0, 0, "サレン（サラサリア）", "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 2.09, 1, "されん", 3, 304, 450, 0, 127501, 0, 0, 4, "2024/11/11 12:00:00", 127501, "2024/11/18 11:59:59", 127501, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (4, 127601, 0, 0, "ルカ（サラサリア）", "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 1.965, 0, "るか", 3, 157, 450, 0, 127601, 0, 0, 4, "2023/10/15 15:00:00", 127601, "2030/12/31 15:00:00", 127601, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (48, 127701, 0, 0, "リンド", "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 1.965, 0, "りんど", 3, 693, 450, 0, 127701, 0, 0, 6, "2024/10/10 12:00:00", 127701, "2030/12/31 15:00:00", 127701, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (47, 127801, 0, 0, "ヴルム", "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 1.965, 0, "うるむ", 3, 706, 450, 0, 127801, 0, 0, 7, "2024/10/18 12:00:00", 127801, "2030/12/31 15:00:00", 127801, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 127901, 0, 0, "ペコリーヌ（クリスマス）", "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 1.965, 1, "ぺこりーぬ", 3, 372, 450, 0, 127901, 0, 0, 5, "2024/12/09 12:00:00", 127901, "2024/12/15 14:59:59", 127901, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (35, 128001, 0, 0, "クレジッタ（クリスマス）", "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 2.09, 0, "くれじった", 3, 723, 450, 0, 128001, 0, 0, 35, "2023/12/15 15:00:00", 128001, "2030/12/31 15:00:00", 128001, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 128101, 0, 0, "シズル（シズル&リノ）", "", 0.0, 1, "しずる", 3, 580, 0, 0, 0, 0, 181101, 0, "2015/04/01 15:00:00", 128101, "2030/12/31 15:00:00", 0, 0, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 128201, 0, 0, "リノ（シズル&リノ）", "", 0.0, 1, "りの", 3, 580, 0, 0, 0, 0, 181101, 0, "2015/04/01 15:00:00", 128201, "2030/12/31 15:00:00", 0, 0, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (38, 128301, 0, 0, "イノリ（ニューイヤー）", "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 2.09, 1, "いのり", 1, 191, 450, 0, 128301, 0, 0, 3, "2023/12/31 12:00:00", 128301, "2030/12/31 15:00:00", 128301, 1, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 128401, 0, 0, "ハツネ（ニューイヤー）", "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 2.09, 1, "はつね", 3, 801, 450, 0, 128401, 0, 0, 7, "2025/01/09 12:00:00", 128401, "2025/01/15 14:59:59", 128401, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 128501, 0, 0, "カスミ（ニューイヤー）", "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 2.09, 1, "かすみ", 3, 739, 450, 0, 128501, 0, 0, 7, "2025/01/09 12:00:00", 128501, "2025/01/15 14:59:59", 128501, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 128601, 0, 0, "リリ（フォールン）", "", 0.0, 1, "りり", 3, 0, 0, 0, 0, 0, 0, 1, "2015/04/01 15:00:00", 128601, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 128701, 0, 0, "ヒヨリ（アストラル）", "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 2.09, 1, "ひより", 3, 226, 450, 0, 128701, 0, 0, 1, "2025/02/10 12:00:00", 128701, "2025/02/15 14:59:59", 128701, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 128801, 0, 0, "レイ（アストラル）", "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 1.965, 1, "れい", 1, 194, 450, 0, 128801, 0, 0, 4, "2024/01/31 12:00:00", 128801, "2030/12/31 15:00:00", 128801, 1, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 128901, 0, 0, "ユイ（アストラル）", "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 2.09, 1, "ゆい", 3, 772, 450, 0, 128901, 0, 0, 7, "2025/02/10 12:00:00", 128901, "2025/02/15 14:59:59", 128901, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 129001, 0, 0, "エリス", "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 2.09, 1, "えりす", 3, 800, 450, 0, 129001, 0, 0, 7, "2025/04/30 12:00:00", 129001, "2025/05/03 18:59:59", 129001, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 129301, 0, 0, "ユニ（ウィンター）", "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 2.09, 1, "ゆに", 3, 708, 450, 0, 129301, 0, 0, 7, "2025/03/10 12:00:00", 129301, "2025/03/15 14:59:59", 129301, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (2, 129401, 0, 0, "クロエ（ウィンター）", "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 2.09, 0, "くろえ", 3, 188, 450, 0, 129401, 0, 0, 2, "2024/03/18 12:00:00", 129401, "2030/12/31 15:00:00", 129401, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 129501, 0, 0, "チエル（ウィンター）", "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 2.09, 1, "ちえる", 3, 247, 450, 0, 129501, 0, 0, 1, "2024/12/15 15:00:00", 129501, "2024/12/22 11:59:59", 129501, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 129601, 0, 0, "アネモネ", "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 2.09, 1, "あねもね", 3, 550, 450, 0, 129601, 0, 0, 0, "2025/04/30 12:00:00", 129601, "2025/05/03 18:59:59", 129601, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 129701, 0, 0, "ネフィ＝ネラ", "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 2.09, 1, "ねふぃーねら", 3, 540, 450, 0, 129701, 0, 0, 0, "2025/04/30 12:00:00", 129701, "2025/05/03 18:59:59", 129701, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (5, 129801, 0, 0, "マコト（コマンダー）", "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 2.09, 1, "まこと", 3, 269, 450, 0, 129801, 0, 0, 5, "2025/04/26 12:00:00", 129801, "2025/04/30 11:59:59", 129801, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (48, 129901, 0, 0, "エリコ（コマンダー）", "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 1.84, 0, "えりこ", 3, 294, 450, 0, 129901, 0, 0, 6, "2024/04/15 15:00:00", 129901, "2030/12/31 15:00:00", 129901, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 130001, 0, 0, "ヤマト", "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 2.09, 1, "やまと", 3, 150, 450, 0, 130001, 0, 0, 4, "2025/05/03 19:00:00", 130001, "2025/05/15 14:59:59", 130001, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (9, 130101, 0, 0, "ワカナ", "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 2.09, 1, "わかな", 3, 535, 450, 0, 130101, 0, 0, 7, "2025/05/03 19:00:00", 130101, "2025/05/15 14:59:59", 130101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 130201, 0, 0, "フブキ", "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 1.84, 1, "ふぶき", 3, 371, 450, 0, 130201, 0, 0, 5, "2025/05/03 19:00:00", 130201, "2025/05/15 14:59:59", 130201, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 130601, 0, 0, "レイ（アストラル）", "", 0.0, 1, "れい", 3, 0, 0, 0, 0, 0, 0, 4, "2015/04/01 15:00:00", 130601, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 130701, 0, 0, "キョウカ（スプリング）", "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 1.92, 1, "きょうか", 3, 563, 450, 0, 130701, 0, 0, 7, "2025/05/03 19:00:00", 130701, "2025/05/15 14:59:59", 130701, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 130801, 0, 0, "スズメ（スプリング）", "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 1.84, 0, "すずめ", 3, 558, 450, 0, 130801, 0, 0, 7, "2024/05/15 15:00:00", 130801, "2030/12/31 15:00:00", 130801, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 130901, 0, 0, "クルル", "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 2.09, 0, "くるる", 3, 440, 450, 0, 130901, 0, 0, 7, "2024/06/15 15:00:00", 130901, "2030/12/31 15:00:00", 130901, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 131001, 0, 0, "マホ（ドリームパーク）", "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 1.84, 1, "まほ", 3, 702, 450, 0, 131001, 0, 0, 7, "2024/12/09 12:00:00", 131001, "2024/12/15 14:59:59", 131001, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (52, 131101, 0, 0, "ネア（サマー）", "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 2.09, 0, "ねあ", 3, 165, 450, 0, 131101, 0, 0, 2, "2024/06/30 12:00:00", 131101, "2030/12/31 15:00:00", 131101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (35, 131201, 0, 0, "ミソラ（サマー）", "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 2.09, 1, "みそら", 3, 753, 450, 0, 131201, 0, 0, 35, "2025/01/09 12:00:00", 131201, "2025/01/15 14:59:59", 131201, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 131301, 0, 0, "リリ", "", 0.0, 1, "りり", 3, 0, 0, 0, 0, 0, 0, 1, "2015/04/01 15:00:00", 131301, "2030/12/31 15:00:00", 0, 0, 0, 1);
