INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 131501, 0, 0, "プレシア", "", 0.0, 1, "ぷれしあ", 3, 0, 0, 0, 0, 0, 0, 1, "2015/04/01 15:00:00", 131501, "2030/12/31 15:00:00", 0, 0, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (4, 131601, 0, 0, "リリ（サマー）", "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 1.92, 1, "りり", 3, 399, 450, 0, 131601, 0, 0, 4, "2025/01/09 12:00:00", 131601, "2025/01/15 14:59:59", 131601, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (53, 131701, 0, 0, "アメス（サマー）", "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 1.92, 1, "あめす", 3, 743, 450, 0, 131701, 0, 0, 44, "2025/02/10 12:00:00", 131701, "2025/02/15 14:59:59", 131701, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 131801, 0, 0, "ホマレ（サマー）", "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 2.09, 0, "ほまれ", 3, 709, 450, 0, 131801, 0, 0, 7, "2024/08/15 15:00:00", 131801, "2030/12/31 15:00:00", 131801, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (23, 131901, 0, 0, "エミリア（サマー）", "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 2.09, 1, "えみりあ", 1, 725, 450, 0, 131901, 0, 0, 7, "2024/08/31 12:00:00", 131901, "2030/12/31 15:00:00", 131901, 2, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 132001, 0, 0, "エキドナ（サマー）", "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 2.09, 1, "えきどな", 3, 775, 450, 0, 132001, 0, 0, 7, "2024/09/13 12:00:00", 132001, "2024/09/25 11:59:59", 132001, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (24, 132101, 0, 0, "レム（サマー）", "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 2.09, 1, "れむ", 3, 146, 450, 0, 132101, 0, 0, 13, "2024/08/31 12:00:00", 132101, "2024/09/13 11:59:59", 132101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 132201, 0, 0, "ノゾミ（アルケミスト）", "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 1.84, 1, "のぞみ", 3, 721, 450, 0, 132201, 0, 0, 7, "2025/05/03 19:00:00", 132201, "2025/05/15 14:59:59", 132201, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 132301, 0, 0, "ルイズマリー", "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 2.09, 1, "るいずまりー", 3, 754, 450, 0, 132301, 0, 0, 7, "2025/05/03 19:00:00", 132301, "2025/05/15 14:59:59", 132301, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 132801, 0, 0, "ライラエル（クリスマス）", "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 2.09, 1, "らいらえる", 3, 750, 450, 0, 132801, 0, 0, 7, "2024/11/30 12:00:00", 132801, "2024/12/09 11:59:59", 132801, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (46, 132901, 0, 0, "イオ（クリスマス）", "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 2.09, 0, "いお", 3, 748, 450, 0, 132901, 0, 0, 5, "2024/12/09 12:00:00", 132901, "2030/12/31 15:00:00", 132901, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 133001, 0, 0, "グレイス", "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 2.09, 1, "ぐれいす", 3, 234, 450, 0, 133001, 0, 0, 0, "2025/04/30 12:00:00", 133001, "2025/05/03 18:59:59", 133001, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 133101, 0, 0, "ヴァイオレット", "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 1.75, 1, "うぁいおれっと", 3, 154, 450, 0, 133101, 0, 0, 0, "2025/04/30 12:00:00", 133101, "2025/05/03 18:59:59", 133101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (22, 133201, 0, 0, "モニカ（ニューイヤー）", "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 2.09, 1, "もにか", 1, 296, 450, 0, 133201, 0, 0, 4, "2024/12/31 12:00:00", 133201, "2030/12/31 15:00:00", 133201, 1, 0, 1);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (22, 133501, 0, 0, "サレン（ニューイヤー）", "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 2.09, 1, "されん", 3, 718, 450, 0, 133501, 0, 0, 4, "2025/01/03 19:00:00", 133501, "2025/01/15 14:59:59", 133501, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 133601, 0, 0, "メドゥーサ", "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 2.09, 1, "めどぅーさ", 3, 445, 450, 0, 133601, 0, 0, 0, "2025/01/20 12:00:00", 133601, "2025/01/31 11:59:59", 133601, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 133701, 0, 0, "ラビリスタ（アルファ）", "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 2.09, 1, "らびりすた", 3, 717, 450, 0, 133701, 0, 0, 8, "2025/01/31 12:00:00", 133701, "2025/02/10 11:59:59", 133701, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 133801, 0, 0, "ネネカ（アルファ）", "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 2.09, 1, "ねねか", 3, 759, 450, 0, 133801, 0, 0, 7, "2025/02/20 12:00:00", 133801, "2025/02/28 11:59:59", 133801, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 133901, 0, 0, "クリスティーナ（アルファ）", "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 2.09, 1, "くりすてぃーな", 3, 228, 450, 0, 133901, 0, 0, 6, "2025/02/10 12:00:00", 133901, "2025/02/20 11:59:59", 133901, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 134001, 0, 0, "フィオ", "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 2.09, 1, "ふぃお", 3, 746, 450, 0, 134001, 0, 0, 0, "2025/04/30 12:00:00", 134001, "2025/05/03 18:59:59", 134001, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 134101, 0, 0, "フブキ", "", 0.0, 1, "ふぶき", 3, 0, 0, 0, 0, 0, 0, 5, "2015/04/01 15:00:00", 134101, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 134201, 0, 0, "ライラエル（クリスマス）", "", 0.0, 1, "らいらえる", 3, 0, 0, 0, 0, 0, 0, 7, "2015/04/01 15:00:00", 134201, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 134301, 0, 0, "ランファ（儀装束）", "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 2.09, 1, "らんふぁ", 3, 778, 450, 0, 134301, 0, 0, 7, "2025/03/03 19:00:00", 134301, "2025/03/15 14:59:59", 134301, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (21, 134401, 0, 0, "チカ（儀装束）", "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 2.09, 0, "ちか", 3, 773, 450, 0, 134401, 0, 0, 7, "2025/03/15 15:00:00", 134401, "2030/12/31 15:00:00", 134401, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 134501, 0, 0, "クローチェ（エアリアル）", "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 2.09, 1, "くろーちぇ", 3, 719, 450, 0, 134501, 0, 0, 0, "2025/04/08 12:00:00", 134501, "2025/04/15 14:59:59", 134501, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (35, 134601, 0, 0, "アオイ（パイロット）", "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 2.09, 1, "あおい", 3, 526, 450, 0, 134601, 0, 0, 35, "2025/03/31 12:00:00", 134601, "2025/04/08 11:59:59", 134601, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (7, 134701, 0, 0, "ホウオウ", "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 2.09, 1, "ほうおう", 3, 490, 450, 0, 134701, 0, 0, 7, "2025/04/15 15:00:00", 134701, "2025/04/26 11:59:59", 134701, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 136601, 0, 0, "メドゥーサ", "", 0.0, 0, "めどぅーさ", 1, 0, 0, 0, 0, 0, 0, 1, "2015/04/01 15:00:00", 136601, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 136701, 0, 0, "ラビリスタ（アルファ）", "", 0.0, 1, "らびりすた", 3, 0, 0, 0, 0, 0, 0, 8, "2015/04/01 15:00:00", 136701, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (1, 136801, 0, 0, "ランファ（儀装束）", "", 0.0, 1, "らんふぁ", 3, 0, 0, 0, 0, 0, 0, 7, "2015/04/01 15:00:00", 136801, "2030/12/31 15:00:00", 0, 0, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (34, 170101, 4, 0, "ジータ", "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 1.965, 0, "じーた", 3, 245, 450, 0, 170101, 0, 0, 34, "2015/04/01 15:00:00", 170101, "2030/12/31 15:00:00", 105701, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180101, 7, 0, "ヒヨリ（プリンセス）", "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 1.62, 1, "ひより", 3, 199, 450, 0, 180101, 0, 0, 0, "2025/04/30 12:00:00", 180101, "2025/05/03 18:59:59", 180101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180201, 1, 0, "ユイ（プリンセス）", "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 1.92, 1, "ゆい", 3, 767, 450, 0, 180201, 0, 0, 0, "2025/04/30 12:00:00", 180201, "2025/05/03 18:59:59", 180201, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180301, 7, 0, "レイ（プリンセス）", "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 1.965, 1, "れい", 3, 377, 450, 0, 180301, 0, 0, 0, "2025/04/30 12:00:00", 180301, "2025/05/03 18:59:59", 180301, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180401, 1, 0, "ペコリーヌ（プリンセス）", "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 1.965, 1, "ぺこりーぬ", 3, 155, 450, 0, 180401, 0, 0, 0, "2025/04/30 12:00:00", 180401, "2025/05/03 18:59:59", 180401, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180501, 1, 0, "コッコロ（プリンセス）", "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 2.14, 1, "こっころ", 3, 555, 450, 0, 180501, 0, 0, 0, "2025/04/30 12:00:00", 180501, "2025/05/03 18:59:59", 180501, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180601, 1, 0, "キャル（プリンセス）", "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 1.92, 1, "きゃる", 3, 747, 450, 0, 180601, 0, 0, 0, "2025/04/30 12:00:00", 180601, "2025/05/03 18:59:59", 180601, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180701, 1, 0, "ハツネ＆シオリ", "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 1.75, 1, "はつねしおり", 3, 732, 450, 0, 180701, 0, 0, 0, "2025/04/30 12:00:00", 180701, "2025/05/03 18:59:59", 180701, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180801, 1, 0, "ミソギ＆ミミ＆キョウカ", "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 1.5, 1, "みそぎみみきょうか", 3, 465, 450, 0, 180801, 0, 0, 0, "2025/04/30 12:00:00", 180801, "2025/05/03 18:59:59", 180801, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 180901, 1, 0, "アキノ＆サレン", "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 2.09, 1, "あきのされん", 3, 421, 450, 0, 180901, 0, 0, 0, "2025/04/30 12:00:00", 180901, "2025/05/03 18:59:59", 180901, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 181001, 1, 0, "アン＆グレア", "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 2.09, 1, "あんぐれあ", 3, 577, 450, 0, 181001, 0, 0, 0, "2025/04/30 12:00:00", 181001, "2025/05/03 18:59:59", 181001, 2, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 181101, 1, 0, "シズル＆リノ", "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 1.92, 1, "しずるりの", 3, 551, 450, 0, 181101, 0, 0, 0, "2025/04/30 12:00:00", 181101, "2025/05/03 18:59:59", 181101, 1, 0, 0);
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 181201, 1, 0, "シェフィ（プリンセス）", "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", 1.92, 1, "しぇふぃ", 3, 368, 450, 0, 181201, 0, 0, 0, "2025/04/30 12:00:00", 181201, "2025/05/03 18:59:59", 181201, 1, 0, 0);
